import React from "react";
import { StyleSheet, Text, View, ImageBackground, Modal, Button} from 'react-native';
import styles from "./styles";
import StyleButton from "../StyleButton";
import MicroButton from "../MicroButton";

const EyeItem=(props)=>{
  const [selectedVideo, setSelectedVideo] = useState(null);

    const handlePress1 = () => {
      setSelectedVideo('https://www.example.com/video1.mp4');
    };
  
    const handlePress2 = () => {
      setSelectedVideo('https://www.example.com/video2.mp4');
    };
  
    //const{name,tagline, image}=props;
    return (
        <View style={styles.eyeContainer}>
          

        <ImageBackground 
        source={require('D:\\Facultate Anul III\\SeverinReactApp\\reactappn\\assets\\images\\Backphoto2.jpg')}
        style={styles.image}
        />

        

        <View style={styles.titles}>
          <Text style={styles.title}>We Become Your Eyes</Text>
          <Text style={styles.subtitles}>Here To Help You</Text>
        </View>
        <View style={styles.buttMicrophone}>
          <MicroButton/>

        </View>
        <View style={styles.buttonsContainer}>
        <StyleButton 
        type="primary" 
        content={"Use My Eye"}
        onPress={handlePress1}
        />

        <StyleButton 
        type="secondary" 
        content={"Use My Eye In Other Form"}
        onPress={() =>{
           console.warn("buttonPress2"); 
        }}
        />
        </View>
      </View>
    );

};

export default EyeItem;
